(()=>{return()=>{SpinQuery.any(()=>$("span.settings-category"),n=>{const e=$("meta[itemprop='image']");if(e.length>0){$(n.filter((n,e)=>e.innerHTML==="视频")).parent().after(`\n                <li class="indent-center">\n                <button\n                    class="gui-settings-button"\n                    title="查看当前视频的封面"\n                    id="view-cover">\n                    查看封面\n                </button>\n                </li>`);$("#view-cover").on("click",()=>{open(e.prop("content"))})}});return{ajaxReload:false}}})();